import React from 'react';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import GitHubIcon from '@mui/icons-material/GitHub';
import './LinkedInOverlay.css';

const LinkedInOverlay = () => {
  return (
    <div className="linkedin-overlay">
              <a href="https://www.github.com/som1shi" target="_blank" rel="noopener noreferrer">
        <GitHubIcon style={{ fontSize: 50, color: 'grey' }} />
      </a>
      <a href="https://www.linkedin.com/in/sarvagyasomvanshi/" target="_blank" rel="noopener noreferrer">
        <LinkedInIcon style={{ fontSize: 50, color: 'grey' }} />
      </a>

    </div>
  );
};

export default LinkedInOverlay;
